inity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1664042","type":"CustomJS"},{"attributes":{},"id":"1663759","type":"BasicTickFormatter"},{"attributes":{"format":"0.[00]%"},"id":"1663894","type":"NumeralTickFormatter"},{"attributes":{"line_color":{"value":"#bbbbbb"},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"1663941","type":"Segment"},{"attributes":{},"id":"1664032","type":"AllLabels"},{"attributes":{},"id":"1663703","type":"LinearScale"},{"attributes":{"bottom":{"field":"Close"},"fill_alpha":{"value":0.2},"fill_color":{"field":"inc","transform":{"id":"1663946"}},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"line_color":{"value":null},"top":{"field":"Open"},"width":{"field":"_width"},"x":{"field":"index"}},"id":"1663950","type":"VBar"},{"attributes":{"coordinates":null,"data_source":{"id":"1663692"},"glyph":{"id":"1663879"},"group":null,"hover_glyph":null,"mute
